врач I категории, 
мануальный терапевт, невролог, нутрициолог, прикладной кинезиолог 

является членом Всероссийской Ассоциации мануальной Медицины (ВАММ) 

прошел подготовку в клинической ординатуре при Санкт- Петербургской медицинской академии последипломного образования на кафедре невропатологии, 

-владеет знаниями и навыками и использует новые комплементарные технологии в медицине: сочетание применения методов EMDR, прикладной кинезиологии и гомеопатии в лечении больных; 

повышение квалификации медицинских работников в области: 
-Актуальные вопросы профилактической медицины, фитотерапии и диетологии с использованием БАД; 
-Вегетативная патология и сосудистые заболевания нервной системы; 
-Амбулаторная токсикология; 
-Депрессия в неврологии; 
-Телесно-ориентированная психотерапия; 
-КТ, МРТ в неврологии; 
-Современные методы индивидуальной и групповой психотерапии; 
-Вертеброгенные заболевания нервной системы; 
-Медицинский массаж; 
-Тревожно-депрессивные заболевания; 
-Энергоинформационная медицина. 

Девиз: «Лечить больного, а не болезнь» 
«Сознание невозможности есть начало всякой возможности» 

«Наше тело знает лучше врачей, что с ним в данный момент происходит и что нужно, чтобы оно было здоровым, главное правильно ему помочь» 

"Многих воителей стоит один врачеватель искуссный" Гомер
